import React, { useState, useRef } from 'react';
import { useAuth } from '../context/AuthContext';
import api from '../utils/api';
import './DataUpload.css';

function DataUpload({ onDataUploaded }) {
  const { isDevMode } = useAuth();
  const [file, setFile] = useState(null);
  const [uploading, setUploading] = useState(false);
  const [uploadResult, setUploadResult] = useState(null);
  const [error, setError] = useState(null);
  const [dragActive, setDragActive] = useState(false);
  const fileInputRef = useRef(null);

  if (!isDevMode()) {
    return (
      <div className="upload-unauthorized glass-card-solid">
        <div className="unauthorized-icon">
          <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={1.5} d="M12 15v2m-6 4h12a2 2 0 002-2v-6a2 2 0 00-2-2H6a2 2 0 00-2 2v6a2 2 0 002 2zm10-10V7a4 4 0 00-8 0v4h8z" />
          </svg>
        </div>
        <h3>Access Restricted</h3>
        <p>Data upload is only available in Developer Mode. Please login with developer credentials to upload data.</p>
      </div>
    );
  }

  const handleDrag = (e) => {
    e.preventDefault();
    e.stopPropagation();
    if (e.type === 'dragenter' || e.type === 'dragover') {
      setDragActive(true);
    } else if (e.type === 'dragleave') {
      setDragActive(false);
    }
  };

  const handleDrop = (e) => {
    e.preventDefault();
    e.stopPropagation();
    setDragActive(false);
    
    if (e.dataTransfer.files && e.dataTransfer.files[0]) {
      handleFileSelect(e.dataTransfer.files[0]);
    }
  };

  const handleFileSelect = (selectedFile) => {
    setError(null);
    setUploadResult(null);
    
    if (!selectedFile.name.match(/\.(xlsx|xls)$/)) {
      setError('Please select a valid Excel file (.xlsx or .xls)');
      return;
    }
    
    setFile(selectedFile);
  };

  const handleInputChange = (e) => {
    if (e.target.files && e.target.files[0]) {
      handleFileSelect(e.target.files[0]);
    }
  };

  const handleUpload = async () => {
    if (!file) {
      setError('Please select a file first');
      return;
    }

    setUploading(true);
    setError(null);
    setUploadResult(null);

    const formData = new FormData();
    formData.append('file', file);

    try {
      const response = await api.post('/api/upload', formData, {
        headers: {
          'Content-Type': 'multipart/form-data'
        }
      });
      
      setUploadResult(response.data);
      setFile(null);
      if (fileInputRef.current) {
        fileInputRef.current.value = '';
      }
      
      if (onDataUploaded) {
        onDataUploaded();
      }
    } catch (err) {
      setError(err.response?.data?.error || 'Upload failed. Please try again.');
    } finally {
      setUploading(false);
    }
  };

  const handleClear = () => {
    setFile(null);
    setError(null);
    setUploadResult(null);
    if (fileInputRef.current) {
      fileInputRef.current.value = '';
    }
  };

  return (
    <div className="data-upload">
      <div className="upload-header">
        <h1>Data Upload</h1>
        <p className="upload-description">Upload Excel file with daily KPI data and feature configuration</p>
      </div>

      <div className="upload-content">
        <div className="upload-section glass-card-solid">
          <h3>Upload Data File</h3>
          
          <div 
            className={`upload-zone ${dragActive ? 'drag-active' : ''} ${file ? 'has-file' : ''}`}
            onDragEnter={handleDrag}
            onDragLeave={handleDrag}
            onDragOver={handleDrag}
            onDrop={handleDrop}
            onClick={() => fileInputRef.current?.click()}
          >
            <input
              ref={fileInputRef}
              type="file"
              accept=".xlsx,.xls"
              onChange={handleInputChange}
              style={{ display: 'none' }}
            />
            
            {file ? (
              <div className="file-preview">
                <div className="file-icon">
                  <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={1.5} d="M9 12h6m-6 4h6m2 5H7a2 2 0 01-2-2V5a2 2 0 012-2h5.586a1 1 0 01.707.293l5.414 5.414a1 1 0 01.293.707V19a2 2 0 01-2 2z" />
                  </svg>
                </div>
                <div className="file-info">
                  <span className="file-name">{file.name}</span>
                  <span className="file-size">{(file.size / 1024).toFixed(1)} KB</span>
                </div>
              </div>
            ) : (
              <div className="upload-placeholder">
                <div className="upload-icon">
                  <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={1.5} d="M7 16a4 4 0 01-.88-7.903A5 5 0 1115.9 6L16 6a5 5 0 011 9.9M15 13l-3-3m0 0l-3 3m3-3v12" />
                  </svg>
                </div>
                <p className="upload-text">Drag and drop your Excel file here</p>
                <p className="upload-subtext">or click to browse</p>
              </div>
            )}
          </div>

          {error && (
            <div className="upload-error">
              <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 8v4m0 4h.01M21 12a9 9 0 11-18 0 9 9 0 0118 0z" />
              </svg>
              <span>{error}</span>
            </div>
          )}

          {uploadResult && (
            <div className="upload-success">
              <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 12l2 2 4-4m6 2a9 9 0 11-18 0 9 9 0 0118 0z" />
              </svg>
              <div className="success-details">
                <span className="success-message">{uploadResult.message}</span>
                <span className="success-info">
                  {uploadResult.records} records loaded for {uploadResult.use_cases?.length || 0} use cases
                </span>
              </div>
            </div>
          )}

          <div className="upload-actions">
            <button 
              className="btn-secondary" 
              onClick={handleClear}
              disabled={uploading || (!file && !error && !uploadResult)}
            >
              Clear
            </button>
            <button 
              className="btn-primary" 
              onClick={handleUpload}
              disabled={!file || uploading}
            >
              {uploading ? 'Uploading...' : 'Upload Data'}
            </button>
          </div>
        </div>

        <div className="upload-instructions glass-card-solid">
          <h3>File Format Requirements</h3>
          
          <div className="instruction-section">
            <h4>Sheet 1: DailyData</h4>
            <p>Contains daily KPI metrics with the following columns:</p>
            <table className="format-table">
              <thead>
                <tr>
                  <th>Column</th>
                  <th>Type</th>
                  <th>Description</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <td>date</td>
                  <td>Date</td>
                  <td>Date of the data point (YYYY-MM-DD)</td>
                </tr>
                <tr>
                  <td>use_case</td>
                  <td>Text</td>
                  <td>Name of the use case/feature</td>
                </tr>
                <tr>
                  <td>visits</td>
                  <td>Number</td>
                  <td>Total visits</td>
                </tr>
                <tr>
                  <td>orders</td>
                  <td>Number</td>
                  <td>Total orders</td>
                </tr>
                <tr>
                  <td>revenue</td>
                  <td>Number</td>
                  <td>Total revenue in USD</td>
                </tr>
                <tr>
                  <td>cvr</td>
                  <td>Number</td>
                  <td>Conversion rate percentage</td>
                </tr>
                <tr>
                  <td>aov</td>
                  <td>Number</td>
                  <td>Average order value in USD</td>
                </tr>
                <tr>
                  <td>rpv</td>
                  <td>Number</td>
                  <td>Revenue per visit in USD</td>
                </tr>
              </tbody>
            </table>
          </div>

          <div className="instruction-section">
            <h4>Sheet 2: FeatureConfig</h4>
            <p>Defines the launch date for each use case:</p>
            <table className="format-table">
              <thead>
                <tr>
                  <th>Column</th>
                  <th>Type</th>
                  <th>Description</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <td>use_case</td>
                  <td>Text</td>
                  <td>Name of the use case (must match DailyData)</td>
                </tr>
                <tr>
                  <td>launch_date</td>
                  <td>Date</td>
                  <td>Feature launch date (YYYY-MM-DD)</td>
                </tr>
                <tr>
                  <td>description</td>
                  <td>Text</td>
                  <td>Optional description of the feature</td>
                </tr>
              </tbody>
            </table>
          </div>

          <div className="instruction-note">
            <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={1.5} d="M13 16h-1v-4h-1m1-4h.01M21 12a9 9 0 11-18 0 9 9 0 0118 0z" />
            </svg>
            <p>
              Ensure your data includes both this year (TY) and last year (LY) data for accurate pre/post analysis. 
              The system calculates windows based on today minus the launch date.
            </p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default DataUpload;
